import React from "react";

const Contact = () => {
  return (
    <section id="contact">
      <h2>Contact</h2>
      <p>Email: your-email@example.com</p>
      <p>LinkedIn: your-linkedin-profile</p>
      <p>GitHub: your-github-profile</p>
    </section>
  );
};

export default Contact;
